import React from 'react';
  
const Profile = () => {
  return (
    <div
      style={{
        display: 'flex',
        justifyContent: 'Right',
        alignItems: 'Right',
        height: '100vh'
      }}
    >
      <h1>Annual Report</h1>
    </div>
  );
};
  
export default Profile;
